.card-header span {
    margin-left: 10px;
}
.search-box{
    display: flex;
    align-items: center;
    justify-content: flex-start;
    margin-bottom: 30px;
    .search-group{
        margin-top: 0 !important;
        margin-bottom: 0 !important;
    }
}
.top-holder {
    margin-top: 12px;
}
.filter-left{
    .card-body{
        padding-left: 0;
    }
    .text-primary{
        padding-left: 0;
    }
    .col-sm-10{
        padding-left: 0;
    }
}
.vehicle {
    .select-box{
        margin-top: 6px;
    }
    .my-condition-btn{
        margin-top: 2px!important;
    }
    table {
        .btn {
            color: white;
        }
    }
    .show-google-gaode{
        .bottom-ok-btn{
            margin-top: 20px;
            padding-top: 10px;
            text-align: right;
            border-top: 1px solid #23282c;
        }
    }
    width: 100%;

    .link-to-detail {
        cursor: pointer;
        color: #20a8d8;

        &:hover {
            text-decoration: underline;
        }
    }

    .search-group {
        width: 70%;
        margin-top: 2%;
        display: inline-block;

        input {
            height: 40px;
        }

        button {
            margin-left: 0px;
            height: 36px;
        }

        a {
            margin-left: 10%;
        }
    }
    .my-check-box{
        margin-right: 5px;
    }


    .collapse-m {
        border-color: #1FA8D8;
        border-style: dashed;
    }

    .table-outline {
        margin-top: 2%;
    }

    .filter-content {
        display: inline-block;
    }

    .header-right {
        float: right;

        button {
            background-color: #20a8d8 !important;
            border-color: #20a8d8 !important;
        }
    }
}

